  NOTICE_PYTHON_EXEC_PATH_CUSTOM_FAILED_TITLE: "\u0641\u0634\u0644 \u0645\u0633\u0627\u0631 Python \u0627\u0644\u0645\u062E\u0635\u0635",
  NOTICE_PYTHON_EXEC_PATH_CUSTOM_FAILED_DESC: "\u0645\u0633\u0627\u0631 \u0645\u0644\u0641 Python \u0627\u0644\u062A\u0646\u0641\u064A\u0630\u064A \u0627\u0644\u0645\u062E\u0635\u0635 '{path}' \u063A\u064A\u0631 \u0635\u0627\u0644\u062D \u0623\u0648 \u0644\u0627 \u064A\u0645\u0643\u0646 \u062A\u0646\u0641\u064A\u0630\u0647. \u0627\u0644\u0631\u062C\u0648\u0639 \u0625\u0644\u0649 \u0627\u0644\u0643\u0634\u0641 \u0627\u0644\u062A\u0644\u0642\u0627\u0626\u064A."
