  NOTICE_PYTHON_EXEC_MISSING_FOR_RUN: "\u09B8\u09CD\u0995\u09CD\u09B0\u09BF\u09AA\u09CD\u099F \u099A\u09BE\u09B2\u09BE\u09A8\u09CB \u09AF\u09BE\u09AC\u09C7 \u09A8\u09BE: \u09AA\u09BE\u0987\u09A5\u09A8 \u098F\u0995\u09CD\u09B8\u09BF\u0995\u09BF\u0989\u099F\u09C7\u09AC\u09B2 \u09AA\u09BE\u0993\u09AF\u09BC\u09BE \u09AF\u09BE\u09AF\u09BC\u09A8\u09BF\u0964 \u0985\u09A8\u09C1\u0997\u09CD\u09B0\u09B9 \u0995\u09B0\u09C7 \u0987\u09A8\u09B8\u09CD\u099F\u09B2\u09C7\u09B6\u09A8 \u098F\u09AC\u0982 PATH \u09AA\u09B0\u09C0\u0995\u09CD\u09B7\u09BE \u0995\u09B0\u09C1\u09A8\u0964",
